import React from "react";
import Header from "./Components/Header";
import Contacts from "./Components/Contacts";

import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <Header></Header>
      <Contacts
        name="Giuseppe"
        email="gdilisa@hotmail.com"
        phone="+417678945613"
      ></Contacts>
      <Contacts
        name="Sarah"
        email="sfenton@hotmail.com"
        phone="+417678945613"
      ></Contacts>
    </div>
  );
}

export default App;
